-- ----------------------------
-- Table structure for auth_user
-- ----------------------------
DROP TABLE IF EXISTS `auth_user`;
CREATE TABLE `auth_user`  (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `avatar` int(11) NOT NULL DEFAULT 1 COMMENT '头像',
  `avatar_bg` int(11) NOT NULL DEFAULT 1 COMMENT '头像背景',
  `username` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户名',
  `role_id` int(11) NOT NULL DEFAULT 0 COMMENT '所属角色ID',
  `salt` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '密码盐值',
  `password` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '密码：MD5(原始密码+salt)',
  `realname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '真实姓名',
  `phone` bigint(20) NOT NULL COMMENT '手机号',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '邮箱',
  `sex` tinyint(4) NOT NULL DEFAULT 1 COMMENT '性别（1：男，2：女）',
  `organization` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '所属组织',
  `title` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '普通员工' COMMENT '头衔、职位',
  `is_super_admin` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否为超级管理员（0：否，1：是）',
  `status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '状态（0：无效，1：有效）',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `last_login_time` int(11) NOT NULL DEFAULT 0 COMMENT '最近登录时间',
  `last_login_ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '最近登录IP',
  `login_times` int(11) NOT NULL DEFAULT 0 COMMENT '总登录次数',
  `create_user_id` int(11) NOT NULL COMMENT '创建者ID',
  `modify_version` bigint(20) NOT NULL DEFAULT 0 COMMENT '用户变更版本号',
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE INDEX `uniq_username`(`username`) USING BTREE,
  UNIQUE INDEX `uniq_phone`(`phone`) USING BTREE,
  UNIQUE INDEX `uniq_email`(`email`) USING BTREE,
  INDEX `idx_role_id`(`role_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

